import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './index.css';
import { BrowserRouter } from 'react-router-dom';
import PubNub from 'pubnub';
import { PubNubProvider } from 'pubnub-react';

const getPubnubConfig = () => {
  const settings = localStorage.getItem('pubnub_settings');
  if (settings) {
    const { subscribeKey, publishKey, channel, uuid } = JSON.parse(settings);
    return {
      subscribeKey,
      publishKey,
      uuid,
      ssl: true
    };
  }
  return null;
};

const initializePubNub = () => {
  const config = getPubnubConfig();
  if (!config) {
    return null;
  }
  return new PubNub(config);
};

export const CHANNEL = () => {
  const settings = localStorage.getItem('pubnub_settings');
  if (settings) {
    return JSON.parse(settings).channel;
  }
  return null;
};

export const pubnub = initializePubNub();

const router = {
  future: {
    v7_startTransition: true,
    v7_relativeSplatPath: true
  }
};

ReactDOM.render(
  <React.StrictMode>
    <PubNubProvider client={pubnub}>
      <BrowserRouter future={router}>
        <App />
      </BrowserRouter>
    </PubNubProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
